import logo from './logo.svg';
import './App.css';
import Item from './components/Item.jsx';
import PromptBox from './components/PromptBox.jsx';

function App() {
  return (
    <div className="App">
      {
        /*
        Milk 
        Banana 
        Bread 
        Tomato-12 
        Beans 
        Coriander 
        Salt 2 types 
        Yogurt 
        */
      }
      <Item name='Milk'/>
      <Item name='Banana'/>
      <Item name='Bread'/>
      <Item name='Tomato' count='12'/>
      <Item name='Beans' />
      <Item name='Coriander'/>
      <Item name='Salt' description='2 types'/> 
      <Item name='Yogurt' description='Activa get different flavors, need for tamu' />
      <PromptBox />
    </div>
  );
}

export default App;
